import styled from "styled-components";
import "@fontsource/roboto";
import "@fontsource/arimo";

export const ExampleItemContainer = styled.div`
    color: #FFFFFF;
    font-family: "Arimo", sans-serif;

    width: 100%;
    height: 16px;
    padding-left: 10px;
    padding-right: 20px;

    display: flex;
    justify-content: space-between;

`
